import { Nav,Navbar,NavDropdown,Form,FormControl,Button } from 'react-bootstrap';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';

import Divider from '@material-ui/core/Divider';

import {
  BrowserRouter,
} from 'react-router-dom';

import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';


import '../App.css';

import 'bootstrap/dist/css/bootstrap.min.css';

const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'Date', headerName: 'Date', width: 130 },
  { field: 'State', headerName: 'State', width: 130 },
  {
    field: 'Cost',
    headerName: 'Cost',
    type: 'number',
    width: 90,
  },
  // {
  //   field: 'fullName',
  //   headerName: 'Full name',
  //   description: 'This column has a value getter and is not sortable.',
  //   sortable: false,
  //   width: 160,
  //   valueGetter: (params) =>
  //     `${params.getValue('firstName') || ''} ${params.getValue('lastName') || ''}`,
  // },
];

const rows = [
  { id: 1, Date: 'Snow', State: 'Jon', age: 35 },
  { id: 2, Date: 'Lannister', State: 'Cersei', age: 42 },
  { id: 3, Date: 'Lannister', State: 'Jaime', age: 45 },
  { id: 4, Date: 'Stark', State: 'Arya', age: 16 },
  { id: 5, Date: 'Targaryen', State: 'Daenerys', age: null },
  { id: 6, Date: 'Melisandre', State: null, age: 150 },
  { id: 7, Date: 'Clifford', State: 'Ferrara', age: 44 },
  { id: 8, Date: 'Frances', State: 'Rossini', age: 36 },
  { id: 9, Date: 'Roxie', State: 'Harvey', age: 65 },
];


const useStyles = makeStyles({
  table: {
    margin:'100px',
    minWidth: 650,
    width:'80%'
  },
});



export default function OrderManage() {
  const classes = useStyles();


  return (
    
    
    <React.Fragment>
        <Navbar className="brand-bar" style={{justifyContent:'space-between'}}>
          <Navbar.Brand href="/">Stella Boutique</Navbar.Brand>
            <div>
              hi,Admin
              <Button href="/" className={classes.navButtons} variant="contained" color="primary">
                logout
              </Button>
            </div>
        </Navbar>
        <Navbar bg="dark" variant="dark" className="menu-bar" expand="lg">
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
            <BrowserRouter>
              <Nav.Link href="/ProductManage">PRODUCT</Nav.Link>
              <Nav.Link href="/OrderManage">ORDER</Nav.Link>
              <Nav.Link href="/MemberManage">MEMBER</Nav.Link>
            </BrowserRouter>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      <main>

      <div style={{ height: 400, width: '90%' , margin: '60px'}}>
        <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
      </div>
        
    
      </main>
    </React.Fragment>
  );
}
